// Home.js
import React from 'react';

function Home() {
  return (
    <div className="home-content">
      <h1>Welcome to SAG Awards</h1>
      <p>This is the homepage of SAG Awards.</p>
      <p><strong>Articles Section:</strong> A collection of detailed profiles and analyses on actors, highlighting their contributions, significant roles, and career development across film and television.</p>
      <p><strong>Nomination Section:</strong> Dedicated to the Screen Actors Guild (SAG) Awards, this section provides insights into the nominations, celebrating the achievements and recognition of distinguished actors and industry professionals.</p>
      <p><strong>The Awards Section:</strong> Dedicated to honoring cinematic achievements, this section presents awards across various categories, including Best Comedy Movie. It celebrates excellence in filmmaking and recognizes outstanding contributions in diverse genres, spotlighting the artistry and creativity of the industry's most talented individuals and productions.</p>
    </div>
  );
}

export default Home;
